// REDUCERS
import { overPageShow } from '../../redux/reducers/overPageSlice';
// =====================================================
// LOCATION
import Parameter from '../Parameter/Prameter';
// =====================================================
/* HOOKS */
import { useSelector } from 'react-redux';
import { useDispatch } from 'react-redux';
// =====================================================
// FONT AWESOME
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faAngleDown, faSearch} from '@fortawesome/free-solid-svg-icons';
import { NavLink } from 'react-router-dom';
// =====================================================

const Links = () =>{
    
    const { navbarShow } = useSelector( state => state.navbar ); // SELECT NAVBAR STATE FROM STORE
    
    const dispatch = useDispatch(); // DISPATCH
    // TOGGLE OVERPAGE HANDLE
    const HandleSearchShow = () => {
        dispatch( overPageShow({content:'search'}) );
    }

    let parameterFirst = Parameter().parameterFirst;

    return(
        <div className={
            // TOGGLE MENU BY MOBILE BUTTON MENU
            navbarShow === 0 ? 'links flex-center links-mobile' 
                             : 'links flex-center links-mobile active'
        }>
            <ul className="flex-center">
                <li>
                    <a className={ parameterFirst === '/' ? 'active' : '' } href='/'>Home</a>
                </li>
                <li><a className={ parameterFirst === 'about' ? 'active' : '' } href='about'>About</a></li>
                <li className='services-menu-link'>
                    <a className={ parameterFirst === 'services' ? 'active' : '' } href='services'>Services <FontAwesomeIcon icon={faAngleDown} /></a>
                    <ul className='services-menu'>
                        <li>
                            <NavLink className={( {isActive} ) => isActive ? 'active' : ''} to='services'>
                                <span>Veiw All</span>
                            </NavLink>
                        </li>
                        <li>
                            <NavLink className={( {isActive} ) => isActive ? 'active' : ''} to='services/1'>
                                <span>Design & Planning</span>
                            </NavLink>
                        </li>
                        <li>
                            <NavLink className={( {isActive} ) => isActive ? 'active' : ''} to='services/2'>
                                <span>Interior Design</span>
                            </NavLink>
                        </li>
                        <li>
                            <NavLink className={( {isActive} ) => isActive ? 'active' : ''} to='services/3'>
                                <span>Exterior Design</span>
                            </NavLink>
                        </li>
                        <li>
                            <NavLink className={( {isActive} ) => isActive ? 'active' : ''} to='services/4'>
                                <span>Construction Drawings</span>
                            </NavLink>
                        </li>
                    </ul>
                </li>
                <li>
                    <NavLink className={( {isActive} ) => isActive ? 'active' : ''} to='blogs'>
                        <span>Blogs</span>
                    </NavLink>
                </li>
                <li>
                    <NavLink className={( {isActive} ) => isActive ? 'active' : ''} to='contact'>
                        <span>Contact</span>
                    </NavLink>
                </li>                {/* SEARCH BUTTON */}
                <li onClick={HandleSearchShow}><a href='#/'><FontAwesomeIcon icon={faSearch} /></a></li>
            </ul>
        </div>
    );
}
export default Links;
